INSERT INTO `artikel` (`id`, `judul`, `p1`, `p2`, `p3`, `p4`, `p5`, `p6`, `p7`, `p8`, `p9`, `p10`, `p11`, `p12`, `p13`, `p14`, `p15`, `p16`, `p17`, `p18`, `p19`, `p20`, `p21`, `p22`, `p23`, `p24`, `p25`, `p26`, `p27`, `p28`, `p29`, `p30`, `logo`, `gambar1`, `gambar2`, `gambar3`) VALUES
(10, 'KMA 183 Tahun 2019 - Kurikulum PAI &amp; Bahasa Arab', 'Kementerian Agama telah menetapkan serangkaian Keputusan Menteri Agama (KMA). Salah satunya adalah KMA Nomor 183 Tahun 2019 Tentang Kurikulum Pendidikan Agama Islam (PAI) dan Bahasa Arab Pada Madrasah. Regulasi terbaru ini merupakan pengganti dari peraturan sejenis sebelumnya, KMA Nomor 165 Tahun 2013.\r\n', 'Selain menerbitkan KMA Nomor 183 Tahun 2019 tentang Kurikulum PAI dan Bahasa Arab Pada Madrasah juga diterbitkan KMA Nomor 184 Tahun 2019 tentang Pedoman Implementasi Kurikulum Pada Madrasah. KMA Nomor 184 Tahun 2019 akan menggantikan KMA Nomor 117 Tahun 2014.', 'Meski telah tetapkan pada awal Mei 2019, tetapi Keputusan Menteri Agama ini tidak langsung diberlakukakan. Sebagaimana Ayo Madrasah simak dari poin ketiga KMA tersebut disebutkan bahwa kurikulum ini baru akan dijalankan pada tahun pelajaran 2020/2021. Sehingga pada tahun pelajaran ini, 2019/2020, penyelenggaraan pendidikan di madrasah masih menggunakan regulasi yang lama yakni KMA Nomor 165 Tahun 2013.', 'KMA Nomor 183 Tahun 2019', 'KMA Nomor 183 Tahun 2019 Tentang Kurikulum Pendidikan Agama Islam (PAI) dan Bahasa Arab Pada Madrasah memiliki ruang lingkup, yang terdiri atas:', '1. Kerangka Dasar Kurikulum PAI dan Bahasa Arab\r\n2. Standar Kompetensi Lulusan dan Standar Isi PAI dan Bahasa Arab\r\n3. Pembelajaran PAI dan Bahasa Arab\r\n4. Penilaian PAI dan Bahasa Arab\r\n5. Kompetensi Inti (KI) dan Kompetensi Dasar (KD) PAI dan bahasa Arab pada madrasah', 'Kesemuanya berlaku untuk jenjang Madrasah Ibtidaiyah (MI), Madrasah Tsanawiyah (MTs), dan Madrasah Aliyah (MA).', 'Karena memuat berbagai hal di atas, regulasi terkait kurikulum PAI dan Bahasa Arab ini memiliki lampiran yang cukup tebal. Terhitung lampiran keputusan menteri ini mencapai 459 halaman.', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '5f979a11bbdc9.png', '5f979a11c05de.jpg', '5f979a659f4f0.png', ''),
(11, 'Kegiatan Belajar dan Mengajar dilakukan secara Online', 'Diakhir kegiatan yang dilakukan secara luring dengan tetap memperhatikan protokoler kesehatan Covid-19 ini, seluruh guru yang hadir diwajibkan melanjutkan kegiatan penginputan bahan ajar maupun pembuatan soal CBT pada E-Learning Madrasah di rumah untuk keperluan pembelajaran Daring siswa yang akan dimulai Senin lusa.', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '5f979ced4a3eb.png', '5f979ced4a6a5.jpeg', '5f979ced4a9ae.jpeg', '5f979ced4ab90.jpeg');
